import styles from '../assets/css/header.module.css';


const linkStyle = {
  marginRight: 15
}

export default function Header() {
  return (
    <>
    <div style={{height:"45px"}}></div>
    <div className={ styles.bgc } >
      <img src='assets/img/Chika.png' />
    <div>
    <h3>Anime Calendar</h3>
    </div>
    </div>
    
    </>
  )
}
